import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import { ReactComponent as OpenEyeIcon } from 'images/icons/eye-slash.svg';
import { ReactComponent as ClosedEyeIcon } from 'images/icons/eye.svg';
import { signUpThunk } from '../../redux/auth/operations';
import css from './SignupPage.module.css';

const SignupPage = () => {
  const dispatch = useDispatch();

  const [showPassword, setShowPassword] = useState(false);
  const [showRepPassword, setShowRepPassword] = useState(false);

  const initialValues = {
    email: '',
    password: '',
    repeatPassword: '',
  };

  const validationSchema = Yup.object({
    email: Yup.string().required('Email is required.'),
    password: Yup.string()
      .required('Password is required.')
      .min(7, 'Password must be at least 7 characters.'),
    repeatPassword: Yup.string()
      .oneOf([Yup.ref('password'), null], 'Passwords must match')
      .required('Repeat password is required.'),
  });

  const onSubmit = (values, { resetForm }) => {
    dispatch(signUpThunk(values));
    resetForm();
  };

  return (
    <div className={css.container}>
      <div className={css.mainstr}>
        <Formik
          initialValues={initialValues}
          validationSchema={validationSchema}
          onSubmit={onSubmit}
        >
          <Form className={css.form}>
            <h1 className={css.formTitle}>Sign Up</h1>
            <div className={css.formControl}>
              <div className={css.stack}>
                <label className={css.formLabel} htmlFor="unique-id1">
                  Enter your email
                </label>
                <Field
                  id="unique-id1"
                  className={css.input}
                  name="email"
                  type="email"
                  placeholder="Email"
                />
                <ErrorMessage
                  name="email"
                  component="div"
                  className={css.errormessage}
                />
              </div>

              <div className={css.stack}>
                <label className={css.formLabel} htmlFor="unique-id2">
                  Enter your password
                </label>
                <div className={css.inputBox}>
                  <Field
                    id="unique-id2"
                    className={css.inputpassword}
                    name="password"
                    type={showPassword ? 'text' : 'password'}
                    placeholder="Password"
                  />
                  <div
                    className={css.iconeye}
                    onClick={() => setShowPassword(!showPassword)}
                    style={{
                      cursor: 'pointer',
                      marginTop: 'auto',
                      marginBottom: 'auto',
                    }}
                  >
                    {showPassword ? <ClosedEyeIcon /> : <OpenEyeIcon />}
                  </div>
                </div>
                <ErrorMessage
                  name="password"
                  component="div"
                  className={css.errormessage}
                />
              </div>

              <div className={css.stack}>
                <label className={css.formLabel} htmlFor="unique-id3">
                  Repeat your password
                </label>
                <div className={css.inputBox}>
                  <Field
                    id="unique-id3"
                    className={css.inputpassword}
                    name="repeatPassword"
                    type={showRepPassword ? 'text' : 'password'}
                    placeholder="Repeat password"
                  />
                  <div
                    className={css.iconeye}
                    onClick={() => setShowRepPassword(!showRepPassword)}
                    style={{
                      cursor: 'pointer',
                      marginTop: 'auto',
                      marginBottom: 'auto',
                    }}
                  >
                    {showRepPassword ? <ClosedEyeIcon /> : <OpenEyeIcon />}
                  </div>
                </div>
                <ErrorMessage
                  name="repeatPassword"
                  component="div"
                  className={css.errormessage}
                />
              </div>

              <button className={css.button} type="submit">
                Sign Up
              </button>

              <Link to="/signin" className={css.signin}>
                <p className={css.signinText}>Sign in</p>
              </Link>
            </div>
          </Form>
        </Formik>
      </div>
    </div>
  );
};

export default SignupPage;
